import React from "react";
import Navigation from "./Navigation";

const Cards = () => {
  return (
    <div
      className="MyCards "
      style={{
        background: "url('./img/walter.png')",
        backgroundRepeat: "no-repeat",

        height: "100vh",
        backgroundSize: "cover"
      }}
    >
      <div>
        <img src="./img/logo.png" alt="walter" className=" h-auto" />
      </div>
    </div>
  );
};

export default Cards;
